import React from 'react'
import {Link} from 'react-router-dom'
function header() {
    return (
        <header style = {headerStyle}>
            <h1>TodoList</h1>
            <Link to="/">Home</Link> | <Link to = "/aboutus">About us</Link>
        </header>
    )
}
const headerStyle = {
    color: '#fff',
    textAlign: 'center',
    padding: '10px',
    background: '#000'
}
export default header;
